B.a5U=new A.X(B.kb,["\ud83e\udde0","Dunning\u2013Kruger effect","FCEFC7","Overestimating ability; lacking self-awareness","The Dunning\u2013Kruger effect is a cognitive bias where people with low ability, knowledge, or expertise in a particular area overestimate their own competence. Conversely, those with high ability often underestimate their competence. This effect results in poor performers being unaware of their own lack of skill and thus overconfident, while skilled individuals might doubt their abilities."],t.w)
B.a5W=new A.X(B.kb,["\u2728","Assembly bonus effect","C9F6E6","Enhance performance in group settings","The 'Assembly bonus effect' refers to the improved overall performance or value achieved when individual components or parts are assembled together, exceeding the sum of their separate effects. This synergy occurs because the integrated system optimizes interactions and functions more efficiently, often observed in various fields like manufacturing, technology, and biology, where combined elements work better together than individually."],t.w)
B.a5V=new A.X(B.kb,["\ud83c\udf1f","Lake Wobegon effect","E9E1FD","Everyone believes they're above average","The \u2018Lake Wobegon effect\u2019 is a cognitive bias where individuals overestimate their own abilities and qualities, believing they are above average compared to others. Named after Garrison Keillor's fictional town where \u2018all the children are above average,\u2019 this effect highlights the tendency for people to rate themselves unrealistically high in areas like intelligence, competence, and attractiveness."],t.w)
B.a5X=new A.X(B.kb,["\ud83d\udede","The wagon-wheel effect","E5F3FD","Illusion of wheels spinning backwards","It is an optical illusion where a spoked wheel appears to rotate differently from its actual motion. When viewed under certain conditions, such as in film or under stroboscopic light, the wheel may seem to rotate slowly, backward, or stand still, despite moving forward rapidly. It is caused by the timing of visual snapshots relative to the wheel's position, creating misperceptions of its true motion."],t.w)
