B.a62=new A.X(B.nf,["https://adityamotale.github.io/think_school_release/public/images/c_02.png","\u2018Buy Now Pay Later\u2019 Industry","May 10, 2024","Governance","In the past 2 years, the \u2018Buy Now Pay Later\u2019 Industry has been one of the\xa0fastest growing\xa0industries in India.\n\nWhat\u2019s absolutely mind blowing is that the BNPL market is growing so fast, that it has achieved an insane growth rate of 569% in 2020 and\xa0637%\xa0in 2021!\n\nBut on 20th of June 2022, the Reserve Bank of India made an announcement that shook the entire BNPL industry!\n\nThis notification disallowed non-bank prepaid wallets and prepaid cards from loading credit lines into these platforms.\n\nFirst we need to understand how these Buy Now Pay Later companies make money and where they fit in the market.\n\nIf you look at the\xa0income\xa0and the\xa0ticket size\xa0of credit in the Indian market you will see that, while car loans are given to people with average income of 3 Lakhs per annum with a ticket size of 5\u20137 Lakhs, a credit card is issued to people with average incomes of more than 1.44 Lakhs per annum, with a limit of 25\u201350,000 rupees.\n\n![Image 1](https://adityamotale.github.io/think_school_release/public/images/c_02_01.png)\n\nIn short, the \u2018Buy Now Pay Later\u2019 Industry stands on the foundation of India\u2019s credit gap!\nThese BNPL services work just like a Credit Card EMI. If you are a student who wants to buy a pair of shoes for 3000 rupees, but then you have only 1500 rupees in your account and your pocket money is only 2000 rupees. You wouldn\u2019t be able to purchase it.\n\nSo you can get your 2000 rupees of pocket money and pay 1000 rupees every month to settle your bill!\n\n![Image 2](https://adityamotale.github.io/think_school_release/public/images/c_02_02.png)\n\nNow the question is, if Slice charges you\xa00% interest, how do they make profits?\n\nIf you look at this transaction closely, you will realize that in spite of you being a student without a credit card, not having enough bank balance and having less pocket money, a pair of shoes worth 3000 rupees became affordable for you!\n\nJust like yourself, those shoes became affordable for thousands of college students in the market. If previously only 100 rich kids in your college could buy those shoes, now 10,000 students in the college can afford them!\n"],t.w)
B.a60=new A.X(B.nf,["https://adityamotale.github.io/think_school_release/public/images/c_03.png","How did Maggi become a household name in India?","May 05, 2024","Business","> Maggi\xa0is one of the most iconic brands in Indian business history! It has been an integral part of our childhood! But from the business standpoint, the most fascinating thing about Maggi is that back in 1983, both Maggi and instant noodles were completely alien to the majority of Indians!\n\nNestl\xe9 single handedly created a\xa0937 cr market\xa0and has been a market leader in the domain for 38 years! Despite giant rivals like ITC, Marico and Unilever, Maggi has a whooping 60% market share in the instant noodle segment!\nThe question is: How did Nestl\xe9 create a market for a seemingly\xa0alien dish\xa0in India?\n\nHow did establish a\xa0monopoly\xa0in the instant noodles market? And what are the lessons that we need to learn from the genius\xa0marketing strategy\xa0of Nestl\xe9?\n\nThis is a story that dates back to 1950s Japan. During that time, the country was still recovering from the downfall of World War 2 and noodles were one of the most affordable foods in the market. It was during this time that a japanese man named Momofuku Ando created a type of noodles that could be prepared quickly and cheaply, making the revolutionary product that we know today as the\xa0Instant Ramen noodles!\n\n![Image 1](https://adityamotale.github.io/think_school_release/public/images/c_03_01.png)\n\nDuring 1983, the pain point for mothers was offering their children a less tedious, but tasty and filling snack after school. A hectic day wouldn\u2019t allow both working parents and homemakers to cook more than three whole meals a day.\n\nThis is how the tagline\xa0\u201c2 Minute Mein Maggi\u201d\xa0was born. We\u2019ve all seen the commercial; it showcases a mother preparing maggi for the kids only to see them delighted by its taste!\n\nApart from this tactic, Nestl\xe9 also reached out to school kids, sponsored quizzes and events and even gave them free hampers of Maggi products. This was followed by a Widespread sampling, with over 4 million new contacts every year. Nestl\xe9 also began advertising on TV channels during the peak time, when people like you and me were watching Power Rangers, Dragon Ball Z and Ninja Hathori!\n\nIn technical terms, based on socio-economic status, the Indian audience could be categorised into 7 categories ranging from\xa0A1 to E2,\xa0The top segment consisted of SEC classes\xa0A1, A2 and B1,\xa0the middle segment was\xa0B2 and C\xa0and the bottom segment was\xa0D E1 E2.\n\n![Image 2](https://adityamotale.github.io/think_school_release/public/images/c_03_02.png)\n\nThe top and middle segment was already captured by 2005 through their conventional efforts, but they saw that the real opportunity was in SEC classes C and D that represented over\xa040%\xa0of the market.\n\nLastly, as I have repeatedly said, while good brands sell you a product, great brands sell you an emotion. It even pertains to a simple dry cake of Noodles.\n\n> People might forget what you said but they will never forget how you made them feel!\n"],t.w)
